import React from 'react'

const QuestionPalette = ({questions,onSequenceNumClick}) => {

const HandleClick =(sequenceNum)=>{
    onSequenceNumClick(sequenceNum)

}

  return (
    <> {questions &&  (
        questions.map((question, index) => (
          <div class="btn-group m-2" role="group" key={question.sequenceNum}>
            <button
              type="button"
              class="btn btn-outline-secondary px-3"
              onClick={HandleClick(question.sequenceNum) }
            >
              {question.sequenceNum}
            </button>
          </div>
        ))
      ) }</>
  )
}

export default QuestionPalette
